      params: { query: query },
      headers: {
        "X-RapidAPI-Key": "87827f1c84mshcc050ec80bd24e2p16bcdfjsnc548a5060814",
        "X-RapidAPI-Host": "tripadvisor16.p.rapidapi.com",
      },
    };

